import About from './components/About';
import Skills from './components/Skills';
import Projects from './components/Projects';
import IntroAnimation from './components/IntroAnimation';
import AOS from 'aos';
import 'aos/dist/aos.css';
import './App.css';

function App() {


  return (
    <div className="App">
      <Navbar />
      <Header />
      <About />
      <Skills />
      <Projects />
    </div>
  );
}

export default App;
